import { Routes, Route } from "react-router-dom";
import Home from "./pages/Home/Home";

import Error from "./pages/Error/Error.jsx";

function App() {
	return (
		<div className="App">
			<Header />
			<main>
				<Routes>
					<Route path="/" element={<Home />} />
					<Route path="*" element={<Error />} />
				</Routes>
			</main>
			<Footer />
		</div>
	);
}

export default App;
